export class Box {
  number1: number;
  number2: number;
  number3: number;
  number4: number;
  number5: number;
  number6: number;

  constructor(numbers: number[]) {
    this.number1 = numbers[0];
    this.number2 = numbers[1];
    this.number3 = numbers[2];
    this.number4 = numbers[3];
    this.number5 = numbers[4];
    this.number6 = numbers[5];
  }

  getNumbers():Set<number> {
    return new Set([this.number1, this.number2, this.number3, this.number4, this.number5, this.number6]);
  }
}
